CREATE DEFINER=`gloreus_tdodin68`@`%` PROCEDURE `add_order_product`(
	in i_price_name varchar(32),
	in i_order_id int,
	in i_prod_code varchar(32),
	in i_cnt int)
BEGIN
		select
			i_order_id, p.product_code, i_cnt, i_cnt * p.value
		from Price p
		where
			p.price_name = i_price_name
			and p.product_code = i_prod_code;

END$$

CREATE DEFINER=`gloreus_tdodin68`@`%` PROCEDURE `get_basket_by_codes`(
	in i_codes varchar(4096),
	in i_price_name varchar(32))
BEGIN
	-- i_codes строка вида "(cod1,cod2,cod3) " co скобками
	-- Без цены товар не продаём!
	set @q = CONCAT("
		select t.code, hex(t.code) as hcode, t.name, p.value as price from
		TreeItem t
			join Price p on p.price_name = '", i_price_name,  "'
		    and p.product_code = t.code
		where
			t.is_node = 0
			and t.code in ",  i_codes);
	prepare q_sql from @q;
	execute q_sql;
	deallocate prepare q_sql; 
END$$

CREATE DEFINER=`gloreus_tdodin68`@`%` PROCEDURE `get_path_by_code`(in i_code varchar(32))
BEGIN
	set @node = NULL;
	select t.parent into @node from TreeItem t where t.code = i_code;
	if @node > '' then 
		select t.code, t.name  from TreeItem t
		where position(t.code in @node) =  1;
	end if;
END$$

CREATE DEFINER=`gloreus_tdodin68`@`%` PROCEDURE `get_product`(in i_code varchar(32), in i_price_name varchar(32))
BEGIN
	select
		  t.code
		, t.name
		, t.description
                , t.CountOnStock
		, p.value as price
		, ph1.href as large_image_url
		, ph2.href as full_image_url
    from
		TreeItem t
		left join Price p on p.price_name = i_price_name and p.product_code = t.code
		left join Photos ph1 on t.code = ph1.product_code and ph1.size = 'L'
		left join Photos ph2 on t.code = ph2.product_code and ph2.size = 'orig'
	
	where
		t.is_node = 0
		and t.code = i_code
	order by t.code;
END$$

CREATE DEFINER=`gloreus_tdodin68`@`%` PROCEDURE `get_products`(in i_code varchar(32), in i_price_name varchar(32))
BEGIN
	select t.code, hex(t.code) as hcode, t.name, t.description, t.countOnStock, ph.href as small_image_url,  ifnull(p.value, 0) as price from
	TreeItem t
		left join Price p on p.price_name = i_price_name and p.product_code = t.code
		left join Photos ph on t.code = ph.product_code and ph.size = 'XS'
	where
		t.is_node = 0
		and t.parent = i_code
	order by t.name;
END$$

CREATE DEFINER=`gloreus_tdodin68`@`%` PROCEDURE `get_rnd_products`(in i_price_name varchar(32))
BEGIN

	select t.code, hex(t.code) as hcode, t.name, t.description, t.countOnStock,  ph.href as small_image_url, ifnull(p.value, 0) as price from
	TreeItem t
		left join Price p on p.price_name = i_price_name and p.product_code = t.code
		left join Photos ph on t.code = ph.product_code and ph.size = 'XS'
	where
		t.is_node = 0
	order by rand() limit 12;
END$$

