CREATE DEFINER=`gloreus_tdodin68`@`%` FUNCTION `get_node_by_code`(i_code varchar(32), force_add int) RETURNS varchar(32) CHARSET cp1251
BEGIN
  set @res = null;
	if i_code = '' then
		return @res;
	end if;

	select code  into @res from TreeItem t  where  t.code = i_code;
	if @res is not null or force_add < 1 then
		return @res;
	end if;

	set @parent_code = null;
	set @i = locate('.', i_code, 1);
	while  @i > 0 do
		set @s = substring(i_code, 1, @i-1) ;

		set @res = null;
		select code  into @res from TreeItem t  where  t.code = @s;
		if @res is null then
				values        (@s, @parent_code,  1);
		end if;
		set @parent_code = @s;
		set @i = locate('.', i_code, @i + 1);
	end while;

		values        (i_code, @parent_code,  1);
	
	RETURN i_code;
END$$

CREATE DEFINER=`gloreus_tdodin68`@`%` FUNCTION `set_node_by_code`(i_code varchar(32), i_name varchar(255), i_desc text, force_add int) RETURNS varchar(32) CHARSET cp1251
BEGIN
	set @node = NULL;
	if force_add > 0 then	
		set @node  = get_node_by_code(i_code, 1);
		update TreeItem t set
			t.name = i_name,
			t.description = i_desc
		where code = @node;
	else
		update TreeItem t set
			t.name = i_name,
			t.description = i_desc
		where t.code = i_code;
		if Row_count() > 0 then
			set @node = i_code;
		end if;
	end if;		
RETURN @node;
END$$

CREATE DEFINER=`gloreus_tdodin68`@`%` FUNCTION `set_product`(i_code varchar(32), i_parent varchar(32), i_name varchar(255), i_desc text, force_add int) RETURNS varchar(32) CHARSET cp1251
BEGIN
	set @res = null;
	select code into @res from TreeItem t
	where t.code = i_code and t.parent = i_parent;

	if @res is null and force_add > 0 then
		values (i_code, i_parent, i_name, i_desc, 0);
		set @res = i_code;
	else
		update TreeItem t set
			t.name = i_name,
			t.description = i_desc
		where t.code = @res;
	end if;
RETURN @res;
END$$

